import './App.css';
import './output.css';

import NavBar from './NavBar';
import Landing from './Landing';
import WebsiteStats from './WebsiteStats';
import NextPage from './NextPage'; // assume you have this component
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className='first-pg'>
        <NavBar />

        {/* Here we render routes */}
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Landing />
                <WebsiteStats />
              </>
            }
          />
          <Route path="/next" element={<NextPage />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
